import 'antd/dist/antd.css';
import { Form, Input, Button, Checkbox, Space} from 'antd';


export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value: null,
    };
  }

   layout = {
    labelCol: {
      span: 8,
    },
    wrapperCol: {
      span: 16,
    },
  };
   tailLayout = {
    wrapperCol: {
      offset: 8,
      span: 16,
    },
  };

  onFinish = (values) => {
    console.log('Success:');
  };

  onClick = () => {
    console.log('EIEI:');
  };

  onFinishFailed = (errorInfo) => {
    console.log('Failed:');
  };

  render() {
    return (
      <div style={{display:'flex',  justifyContent:'center', alignItems:'center' ,height:'100vh'}}>
        <div>
          <Input style={{width:'50%',marginLeft:10}}/>
          <Input.Password style={{width:'50%',marginLeft:10}}/>
          <div>
            <Button style={{width:'30%'}} type="primary" onClick={this.onClick}>
              Submit
            </Button>
            <Button style={{marginLeft:'5%',width:'30%'}} type="primary" onClick={this.onClick}>
              Reset
            </Button>
          </div>
        </div>   
    </div>
    );
  }
}
